import React from "react";

const login = () => {
  return (
    <div className="flex flex-col w-max h-max p-10 text-center justify-center bg-blur my-auto bg-slate-600">
        <div>
            <h1 className="text-2xl text-white font-bold mb-5">Login</h1>
        </div>
        <form>
            <input className="w-full py-2 px-3 rounded-md mb-2" placeholder="Username"/>
            <input className="w-full py-2 px-3 rounded-md mb-5" placeholder="password"/>
            <button className="bg-sky-700 w-full py-2 px-3 rounded-md text-white texl-2xl" type="submit" >Login</button>
        </form>
    </div>
  );
};

export default login;
